import { Wrapper, Status } from "@googlemaps/react-wrapper";
import React, { Component } from "react";

const GOOGLE_MAPS_APIKEY = "AIzaSyDZ4HxogFXeESTTN2JXpPpjCRozf7vEfIk";

class Map2 extends Component {
  onMapPress = (e) => {
    this.setState({
      coordinates: [...this.state.coordinates, e.nativeEvent.coordinate],
    });
  };
  render = (status: Status) => {
    return <h1>{status}</h1>;
  };

  render() {
    return (
      <div>
        <Wrapper apiKey={"YOUR_API_KEY"} render={GOOGLE_MAPS_APIKEY}></Wrapper>
      </div>
    );
  }
}

export default Map2;
